import mongoose, { Schema, model } from 'mongoose'

const datosSchema = new mongoose.Schema({
  temperatura: {
    type: Number,
    required: true
  },
  ph: {
    type: Number,
    required: true
  },
  nivelAgua: {
    type: Number,
